public class InnerGatewayGatewayPlatformFactory(Action<Humidifier.IoTSiteWise.GatewayTypes.GatewayPlatform> factoryAction = null) : SubResourceFactory<Humidifier.IoTSiteWise.GatewayTypes.GatewayPlatform>
{

    internal InnerGatewayGreengrassV2Factory GreengrassV2Factory { get; set; }

    internal InnerGatewayGreengrassFactory GreengrassFactory { get; set; }

    internal InnerGatewaySiemensIEFactory SiemensIEFactory { get; set; }

    protected override Humidifier.IoTSiteWise.GatewayTypes.GatewayPlatform Create()
    {
        var gatewayPlatformResult = CreateGatewayPlatform();
        factoryAction?.Invoke(gatewayPlatformResult);

        return gatewayPlatformResult;
    }

    private Humidifier.IoTSiteWise.GatewayTypes.GatewayPlatform CreateGatewayPlatform()
    {
        var gatewayPlatformResult = new Humidifier.IoTSiteWise.GatewayTypes.GatewayPlatform();

        return gatewayPlatformResult;
    }
    public override void CreateChildren(Humidifier.IoTSiteWise.GatewayTypes.GatewayPlatform result)
    {
        base.CreateChildren(result);

        result.GreengrassV2 ??= GreengrassV2Factory?.Build();
        result.Greengrass ??= GreengrassFactory?.Build();
        result.SiemensIE ??= SiemensIEFactory?.Build();
    }

} // End Of Class

